class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:

        if len(s) == 0:
            return True
        if len(t) == 0:
            return False

        i, j = 0, 0
        print(len(t))
        while i < len(s) and j < len(t):
            if s[i] == t[j]:
                i += 1
            j += 1

        if i != len(s):
            return False

        return True

